function polygon(color,path){
	ctx.save();
	ctx.beginPath();
	ctx.fillStyle=color;
	var points=path.split(" "),
		i=0,
		li=points.length,
		point=points[0].split(",");
	
	ctx.moveTo(point[0]*drawRatio,point[1]*drawRatio);
	while(++i<li){
		point=points[i].split(",");
		ctx.lineTo(point[0]*drawRatio,point[1]*drawRatio);
	}
	ctx.closePath();
	ctx.fill();
	ctx.restore();
}

function svgPath(color,path){
	ctx.save();
	ctx.beginPath();
	ctx.fillStyle=color;
	var rgx = /([A-Z])\s*([0-9.\s,]+)/g;
	var last=[0,0],
		action,
		points;
	
	while(action = rgx.exec(path)){
		points=action[2].split(/[\s,]+/);
		switch(action[1]){
			case "M" :
				ctx.moveTo(points[0]*drawRatio,points[1]*drawRatio);
			break;
			case "L" :
				ctx.lineTo(points[0]*drawRatio,points[1]*drawRatio);
			break;
			case "C" :
				ctx.bezierCurveTo(points[0]*drawRatio,points[1]*drawRatio,points[2]*drawRatio,points[3]*drawRatio,points[4]*drawRatio,points[5]*drawRatio);
			break;
			default : console.log("erreur dans svgPath, action "+action[1]+" inconnue");
		}
	}
	ctx.closePath();
	ctx.fill();
	ctx.restore();
}
